import React from 'react';
import Layout from '../components/layout/layout';
import FullpageSlider from '../components/fullpage/fullpage';

const PageTwo = () => {
  return (
    <Layout page="page-two">
      <FullpageSlider />
    </Layout>
  );
};

export default PageTwo;
